	"description": "The fear and the restlessness of war created a darkness, and corrupted souls were born of the darkness to bring chaos to the world.\nTo prevent chaos from taking over the world, God sent down his holy light to the world. Marian, born of the holy light, was known as a saint by the people, but she lived in a constant fear of being attacked by the corrupted souls.\nHead of the Braver family sent Rentyon, an exorcist of the White Night, to always be by her side and protect her.\nMarian, under Rentyon's protection, was able to awaken her dormant power of the holy light, and through this power, she purified the corrupt souls with Rentyon. While the exorcism was going as planned, another issue began to worry her heart. \n[Ah.... am I really that unattractive? How can he not feel anything? I'll make him change his mind... after all, I'm a saint!]",
