	"description": "Yumeria the Seductive.\nIn order to survive the underworld's fierce battlfields as a woman, special skills are needed to make up for the physical disadvantage.\nYumeria more than made up for the physical disadvantage by absorbing the enemy's lust and greed, and went on making impressive contributions with her lover, Hyuga. However, in the eyes of the members of the Royal Knights that value traditions and chivalry above all, her skills were nothing but foul and crude tricks. Yumeria, however, did not concern herself with how other people thought of her and only concentrated on teaching her female mercenaries her combat skills to improve their survival rate in a battlefield. Most of the mercenaries that were trained by her managed to return back to camp after each battle without any serious injuries.\nAs the Eternal War was approaching its end, the Royal Knights had no need for the mercenaries anymore and wasted no time banishing Yumeria, a constant annoyance for them, as well as her mercenaries and Hyuga from the camp.\nYumeria took in the banished mercenaries and shouted angrily at the Royal Knights.\n[Is this the chivalry of the Royal Knights that you are so proud of! How honorable!]\nShe left the camp, along with Hyuga and her mercenaries.\n[You will all regret this. The war is far from over.]",
