	"elem_stat_point": 0,
	"property": null,
	"description": "Kaisel the Vengeful.\n772 mystic division performed all kinds of brutal experiments on human test subjects. The test subjects were prisoners of war and slaves, and the purpose of the experiments was to create efficient weapons of mass destruction as well as to increase the strength of human beings. \nThe mages that led the experiments believed that history will be on their side and continued on with the cruel and inhumane experimentation. To them, the test subjects were nothing more than animals.\nKaisel was captured and brought to the 772 mystic division. In there, he was subjected to many experiments along with his comrades. He had to watch his comrades and friends die every day. \nThe mages planned to do their one last experiment on Kaisel, having survived countless experiments, but with their kingdom surrendering and losing the war, the experiments had to stop.\nThe 772 mystic division wanted to erase any trace of their experiments before escaping, but Kaisel and the other experiment subjects were faster than they were.\n[Where do you think you're going?]\n[Mercy? Did you say mercy?? When we begged for our lives, what mercy did you show us? You simply laughed and joked that lab test animals were talking again. We are not animals. If we're animals, you people are worse than animals. You are human garbage.]",
