	"elem_stat_point": 0,
	"property": null,
	"description": "The Flatram noble family secretly created an order of knighthood that will remain in the shadows and appointed Fendeo as the leader. In order to increase the morale of the newly created order, a special deal was made - if they completed one hundred successful missions, all members of the order will be made into official knights of the Flatram noble family. \n\nTrusting the words of the nobles, the knights took on absolutely any order from the family and eventually, they were on their way to Haberuit province for their 100th mission. The Spectrum Knights sneaked inside the castle, using the information given by the Flatram family, and just when they were about to assassinate the Lord of the province, they were ambushed and were soon surrounded by countless soldiers that were waiting for them. The Spectrum Knights were caught off-guard and fell one by one.\n\n[Captain! You must run! Get out of here and avenge our deaths! It's a trap!]\n[Hymos, I can't do that. I'll die here with my brothers.]\n[Sir, if you die here, then all our lives would be lost in vain. You must escape!]\n\nFendeo wanted to die with his men, but Hymos and the knights grabbed Fendeo and forced him through the entrance they entered from.\n\n[Captain! Live. Live and avenge the Flatram family for what they have done for us.]\n[Hymos!!! You bastard....]\n\nEvery single knight of the Spectrum were killed that night, except for Fendeo. Having lost everything, Fendeo swore vengeance upon the family that cause everything.\n\n[The Flatram family will pay for what they have done in blood! They have taught and trained me well... and now, I will destroy and devour them one by one... for I am the devil reincarnate of the Spectrum knights!]",
