	"property": null,
	"description": "Haned the Crimson Meteor.\nHaned, also known as the Crimson Meteor in the underworld's battlefields, was originally named Rot Magnolie. \nHe was a child between the Count Vant Magnolie and his mercenary. Nobody blessed his birth. As soon as he was born, he had to suffer the wrath of count's first wife. When Rot Magnolie became 12, she asked for help from her family.\n[The child must die. That's the only way we, the Neferodis family, can take over the Magnolie family.]\n[Alright. It shall be done.]\nWhen Rot Magnolie found out, he escaped the count's manor away from the Neferodis family and joined the mercenary group his mother belonged to before the marriage.\nHe masked his face and grew up as a mercenary under the name Haned. However, the Neferodis family wouldn't leave Haned alone. The assassins hired by the Neferodis family attacked the mercenary group Haned belonged to.\n[We the Crimson Meteor Mercenaries never sell out our own! Haned! Run!]\n[Captain!]\n[We will hold them here. Go with your men through the cracks in the dimension that will lead you to the underworld! Nobody would dare to chase you there! Hurry!]\nAt the captain's words, Haned insisted he would fight alongside his comrades.\n[Go! Go, and return when you are stronger. Go! Hurry!]\n[I will return, captain. I give you my word.]\nHaned threw himself through the cracks of the dimension with his men. At the underworld, Haned and his men swore revenge upon the Neferodis family.\n[There is something a man must do while he is still alive. That's what my fallen brothers would want. I will become stronger.]",
