	"description": "Laiyu the Beast Master.\n\nLaiyu has the ability to commune with nature and is able to control animals to her will. \nShe was quite startled when Hanoa suddenly approached her. \n\n[Why are you here?]\n\n[Midland is in great danger. We need your help.]\n\n[But... it's so peaceful right now. How could it possibly be in danger?]\n\nHanoa didn't know how to explain to Laiyu without saying too much. \nIt was then, when a rough looking man spoke suddenly.\n\n[I'm going too, Laiyu. It's been a while.]\n\n[...Raize? Is that.. you?]\n\n[Yeah, it's me. How have you been doing?]\n\n[Why, you.... you.... cursed dog!!]",
