	"property": null,
	"description": "Due to Neroth's request, Raize had to go see Laiyu along with Hanoa and convince her to come, but this was not something he wished to do.\n\n[Neroth, is it absolutely necessary that I go and talk to Laiyu?]\n\n[Of course. Would you like to go seek Aione then? I'd think you'd get less beating than I would get from Laiyu.]\n\n[Sigh.....]\n\nThus, Raize went with Hanoa to seek Laiyu. There, to convince her, he stepped forward and spoke.\n\n[It's been a while.]\n\n[...Raize? Is that... you?]\n\n[Yeah, it's me. How have you been doing?]\n\nRaize momentarily relaxed, seeing as how Laiyu didn't maul his face off yet, but he instinctively became defensive as soon as he heard her swearing at him.\n\n[I..I'm really sorry! Back then, I was young and stupid... and I wanted to explore Midland with Neroth.]\n\n[Is that so.... where's Neroth?]\n\n[He went to Aione.]\n\nHearing Raize's response, Laiyu sighed and embraced Raize. \n\n[I'll let this one go... but if you ever run away from me again!! Hmm.... I'm worried though...]\n\n[Worried about Neroth?]\n\n[Worried about Aione's city. God knows what she'll do to Neroth.]\n\n[I... I see.]",
