	"description": "Aione the Bright, Blizzard Wolf Neroth, Beast Master Laiyu, and Lightning Raize were the four leaders of mercenaries, but there were very few mercenaries that knew just how they all met. \n\nAione, queen of mercenaries of the east, has been Neroth's lover for a long time, but due to the free-spirited nature of Neroth, Aione always had to wait for him whenever he would go on his adventures. \n\nOne day, while walking down the street, Aione ran into Neroth, who seemed to be thinking deeply about something.]\n\n[Neroth!]\n\n[Uh... Hi, Aione! Long time no see, eh? Hahaha....]\n\n[........long time ... no see....? That's what you have to say to me??]\n\nIt only took couple of punches before Neroth apologized to her. \n\n[Aione! I'm sorry! I'm sorry please don't kill me! Uh..... why are you taking your bow out?]",
