	"description": "Artere served in the Second Eternal War as a summoner, but the war ended up costing her memory. She couldn't remember anything that had happened in the Underworld. All she remembered was that when she came back to Midland, she asked someone to erase her memories for her. Since she did it to her herself, she didn't feel it was necessary to try to get her memories back.\n\nShe built a small cabin near Windy Lake and enjoyed a peaceful, normal life with her summoned pet, Tere. It was then, when one day, a red-haired boy came up to her.\n\n[Wow! This wolf is shiny! Is this yours? You're so pretty!]\n\n[Yes, it's mine.]\n\n[Huh? Why are you crying?]\n\n[I'm... crying? Why... am I crying?]\n\nSeeing the red-haired young boy had this effect on her for some reason.\n\n[Don't cry. Here. Wipe your tears with this.]\n\n[Thank you, little gentleman. What's your name?]\n\nThe little boy smiled and replied. \n[It's Likos. Likos of the Windy Village. Hey!]\n\n[Yeah?]\n\n[Don't cry. You're really pretty when you smile.]\n\n[Ok. I'll always smile from now on.]",
